class Solution {
 public:
  vector<int> findSubstring(string s, vector<string>& words) {
    if (words.size() == 0) return{};

    size_t wd_len = words[0].size();
    unordered_map<string, size_t> wd_idx;
    vector<size_t> wd_count_table;
    for (size_t i = 0; i < words.size(); i++) {
      auto& wd = words[i];
      if (wd_idx.find(wd) != wd_idx.end()) {
        wd_count_table[wd_idx[wd]]++;
      } else {
        wd_idx[wd] = wd_count_table.size();
        wd_count_table.push_back(1);
      }
    }

    vector<int> ans;
    for (size_t i = 0; i < s.size() - words.size() * wd_len + 1; i++) {
      auto count_table = wd_count_table;
      size_t num_remaining_word = words.size();
      size_t pos = i;
      while (true) {
        string sub = s.substr(pos, wd_len);
        if (wd_idx.find(sub) == wd_idx.end()) break;
        size_t idx = wd_idx[sub];
        if (count_table[idx] == 0) break;
        count_table[idx] --;
        num_remaining_word --;
        if (num_remaining_word == 0) {
          ans.push_back(static_cast<int>(i));
          break;
        }
        pos += wd_len;
      }
    }

    return ans;
  }
};

